    lcs[lcs_length] = ''
    i = len(input1)
    j = len(input2)
    while i > 0 and j > 0:
        if input1[i - 1] == input2[j - 1]:
            lcs[lcs_length - 1] = input1[i - 1]
            i -= 1
            j -= 1
            lcs_length -= 1
        elif dp[i - 1][j] > dp[i][j - 1]:
            i -= 1
        else:
            j -= 1
    lcs_string = ''.join(lcs)
    return lcs_string
